import styled,{ ThemeProvider } from "styled-components";


import './App.css';
import Home from "./Home";

function App() {
  return (
    <ThemeProvider>
      <div className="App">
        <container>
          <switch>
            <Route path="/" exact component={Home} />
            <Route/>
            <Route/>
          </switch>
        </container>
      </div>
    </ThemeProvider>
  );
}

export default App;
